function authenticate(resp){
    return dispatch =>{
        console.log('AAAAAAAAAAAAAAAAaa',resp.payload);
        dispatch({
            type : 'authenticate',
            businesscategory : resp.payload.businesscategory,
        })
    }
}

export default {
    authenticate
}
